// login in to the page
cy.visit('https://www.saucedemo.com/');
cy.get('[id="user-name"]').type('standard_user');
cy.get('#password').type('secret_sauce');
cy.get('#login-button').click();
cy.url().should('contain', 'inventory.html');
// select random three character
cy.get('[class="inventory_item"]').then(items => {
  let total = items.length;
  if (total < 3) throw new error("not enough product");
  const randomitems = [];
  while (randomitems.length < 3) {
    const r = Math.floor(Math.random() * total);
    if (!randomitems.includes(r)) {
      randomitems.push(r);
    }
  }
  randomitems.forEach(i => {
    cy.wrap(items[i]).find('button').click();
  });
});
